import "./Demo.css";
import { Link } from "react-router-dom";
import video from "../playground_assets/hero-video1.mp4";
import homeimage from "../playground_assets/home-back.jpg";

const Demo = () => {
  return (
    <div className="Demo-page" style={{ backgroundImage: `url(${homeimage})` }}>
       <div>
       <h1 className="home-text Heading1">
                <span>
                  Do you Really need GST for your
                  <span
                    dangerouslySetInnerHTML={{
                      __html: " ",
                    }}
                  />
                </span>
                <span className="home-text02">
                  Business?
                  <span
                    dangerouslySetInnerHTML={{
                      __html: " ",
                    }}
                  />
                </span>
                <br></br>
                <span>Click below to know</span>
              </h1>
      <Link className="home-button button-primary button" to="/gstchoice">
        {" "}
        GST Tool
      </Link>
       </div>
      <video className="home-image" controls autoPlay src={video} />
    </div>
  );
};

export default Demo;
